import './App.sass';

function App() {
  return (
    <div className="metro-body">
        <header classname="header-part"> 
          <button class="bg-blue-500 hover:bg-blue-700 left: 10px text-white font-bold py-2 px-4 rounded-full">
           Button
          </button>
        </header>
        <main>
          me
          </main>
        <footer>
          we
        </footer>
    </div>
  );
}

export default App;
